import React from 'react'
import '../css/App.css'

const Contact = () => {
  return (
    <div>
      <section class="breadcrumb-osahan pt-5 pb-5 bg-dark position-relative text-center">
         <h1 class="text-white">Contact</h1>
         <h6 class="text-white-50">Contact Us</h6>
      </section>
    </div>

  )
}

export default Contact;
